INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "春咲 ひより", 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 1, 0, 1001);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "草野 優衣", 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 1, 0, 1002);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "士条 怜", 1, 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, "フェンシングを始めてみては？", 0, 1, 1, 0, 1003);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "穂高 みそぎ", 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, "ねぇ、にいちゃん！", 0, 1, 1, 0, 1004);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "風宮 あかり", 1, 0, "私といっしょに…\nいかない？", "ねぇ…", 0, "風宮あかりです", 0, 1, 1, 0, 1006);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "出雲 宮子", 1, 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, "出雲宮子なのー", 0, 1, 1, 0, 1007);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "虹村 雪", 1, 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "ボクは虹村雪。", 0, 1, 1, 0, 1008);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "柊杏奈", 1, 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "フッ…聞いて後悔するがいい！", 0, 1, 1, 0, 1009);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "姫宮 真歩", 1, 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 1, 0, 1010);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "衣之咲 璃乃", 1, 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲璃乃です！", 0, 1, 1, 0, 1011);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "柏崎 初音", 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 1, 0, 1012);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "美波 鈴奈", 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 1, 0, 1016);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "喜屋武 香織", 1, 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, "はいたーい。\n喜屋武香織さー。", 0, 1, 1, 0, 1017);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "支倉 伊緒", 1, 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, "支倉伊緒です。", 0, 1, 1, 0, 1018);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "茜 ミミ", 1, 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 1, 0, 1020);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "栗林 くるみ", 1, 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 1, 0, 1021);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "風宮 より", 1, 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, "風宮よりです。\nあああああ！", 0, 1, 1, 0, 1022);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "北条 綾音", 1, 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 1, 0, 1023);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "天野 すずめ", 1, 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 1, 0, 1025);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "倉石 恵理子", 1, 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, "……クスクス…私は\n…倉石恵理子……", 0, 1, 1, 0, 1027);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "佐々木 咲恋", 1, 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 1, 0, 1028);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "桜井 望", 1, 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井望だよ！\nよろしくねっ", 0, 1, 1, 0, 1029);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "ニノン・ジュベール", 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, "デケデケデンっ！", 0, 1, 1, 0, 1030);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "上喜 しのぶ", 1, 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 1, 0, 1031);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "野戸まひる", 1, 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 1, 0, 1033);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "綾瀬 ゆかり", 1, 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 1, 0, 1034);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.5, 0, 2, "氷川 鏡華", 1, 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, "氷川鏡華…です", 0, 1, 1, 0, 1036);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "柏崎 栞", 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, "柏崎…栞です。", 0, 1, 1, 0, 1038);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "双葉 碧", 1, 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, "ふ、双葉碧です。", 0, 1, 1, 0, 1040);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "三角 千歌", 1, 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角千歌です。", 0, 1, 1, 0, 1042);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "安芸 真琴", 1, 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, "安芸真琴だ。", 0, 1, 1, 0, 1043);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "イリヤ・オーンスタイン", 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, "わらわこそは夜を総べる者！", 0, 1, 1, 0, 1044);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "遠見 空花", 1, 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, "そこで騎士は妖精を乱暴に……", 0, 1, 1, 0, 1045);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "宮坂たまき", 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 1, 0, 1046);
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES (1.4, 0, 2, "大神 美冬", 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, "大神美冬よ！", 0, 1, 1, 0, 1048);
